import React from 'react'
import footerLogo from '../assets/images/png/footer-logo.png'

const Footer = () => {
  return (
      <div className='bg-black pt-[78px] pb-[]'>
          <img src={footerLogo} alt="logo" />
    </div>
  )
}

export default Footer
